        jd_wx_draw_forbidden_quit // 当连续请求493时是否跳出即停止运行脚本（true/false），默认停止运行
        jd_wx_draw_lzkj_pin_filter // 超级无线类活动账号pin过滤，多个用@进行分割
        jd_wx_draw_cjhy_pin_filter // 超级会员类活动账号pin过滤，多个用@进行分割
